import { Link } from "react-router-dom";
import { useEffect,useState } from "react";
import axios from 'axios';
 function TRegister(){
  const[teacherData,setteacherData]=useState({
    'full_name':'',
    'email':'',
    'password':'',
    'qualification':'',
    'mobile_no':'',
    'skills':''
    
  });
   const handelChange=(event)=>{
      setteacherData({ 
        ...teacherData,
         [event.target.name]:event.target.value
     });
    }
   // console.log(teacherData);
   const submitForm=()=>{
    const teacherFormData=new FormData();
    
   }
    useEffect(()=>{
       document.title='Teacher Register';
    });
    return(
        <div className="container">
          <div className="row">
            <div className="col-8 offset-3">
             <div className="card">
                <h5 className="card-header">Teacher Registration</h5>
                  <div className="card-body">
                  <form>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Full Name</label>
    <input onChange={handelChange} name= "full_name" type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Email</label>
    <input onChange={handelChange} name="email" type="email" className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Password</label>
    <input onChange={handelChange} name="password" type="password" className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Qualification</label>
    <input onChange={handelChange} name="qualification"  type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Mobile Number</label>
    <input onChange={handelChange} name="mobile_no" type="number" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Skills</label>
    <textarea onChange={handelChange} name="skills" className="form-control"></textarea>
    
  </div>
  
  <button onChange={handelChange} type="submit" className="btn btn-primary">Register</button>
</form>
                  </div>
                </div> 
             </div>
            </div>
        </div>
    );
}
export default TRegister;
